import React from "react";
import logo from "./../assets/logo_clinic.jpeg";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHouse } from "@fortawesome/free-solid-svg-icons";
import { faInfo } from "@fortawesome/free-solid-svg-icons";
import { faCartShopping } from "@fortawesome/free-solid-svg-icons";
import { faTruck } from "@fortawesome/free-solid-svg-icons";
import { faMessage } from "@fortawesome/free-solid-svg-icons";
import { faUser } from "@fortawesome/free-solid-svg-icons";

const Navbar = () => {
  return (




    <nav className="navbar navbar-expand-lg navbar-light fixed-top" id="nav">
      <div className="container-fluid">

        <a className="navbar-brand" href="#"><img className="logo" src={logo}  /> </a>

        {/* Bouton pour les petits Ã©crans */}
        <button className="navbar-toggler bg-warning text-light" type="button" data-bs-toggle="collapse"
          data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* Contenu de la navbar */}
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item">
              <a className="#"><i className="fa-solid fa-house text-dark"></i>
                Accueil</a>
            </li>


            <li className="nav-item">
              <a className="#"><i className="fa-solid fa-book text-dark"></i> Livre
                d'or</a>
            </li>
            <li className="nav-item">
              <a className="#"><strong><i
                className="fa-solid fa-info"></i></strong> A propos</a>
            </li>

          </ul>
        </div>
      </div>
    </nav>
  );
}


export default Navbar;
